  window.Webflow = window.Webflow || [];
  window.Webflow.push(function () {
    // helpers local to this block
    const navBtn = document.querySelector('.w-nav-button');
    const isNavOpen = () => navBtn && navBtn.getAttribute('aria-expanded') === 'true';
    const isInViewport = (el) => {
      if (!el) return false;
      const rect = el.getBoundingClientRect();
      return (
        rect.top < window.innerHeight &&
        rect.bottom > 0 &&
        rect.left < window.innerWidth &&
        rect.right > 0
      );
    };

    function autoplayTabs_Logos(tabComponentId, initialDelay, intervalTime) {
      const tabComponent = document.querySelector(tabComponentId);
      if (!tabComponent) return;

      const tabLinks = tabComponent.querySelectorAll('.w-tab-link');
      if (!tabLinks.length) return;

      let currentIndex = 0;
      const totalTabs = tabLinks.length;

      function nextTab() {
        if (isNavOpen() || document.hidden || !isInViewport(tabComponent)) {
          setTimeout(nextTab, intervalTime);
          return;
        }
        currentIndex = (currentIndex + 1) % totalTabs;
        tabLinks[currentIndex].click();
        setTimeout(nextTab, intervalTime);
      }

      setTimeout(nextTab, initialDelay);
    }

    // logos only
    autoplayTabs_Logos('#logo-tab1', 3500, 21000);
    autoplayTabs_Logos('#logo-tab2', 14000, 21000);
    autoplayTabs_Logos('#logo-tab3', 7000, 21000);
    autoplayTabs_Logos('#logo-tab4', 17500, 21000);
    autoplayTabs_Logos('#logo-tab5', 10500, 21000);
    autoplayTabs_Logos('#logo-tab6', 21000, 21000);
  });
